//test

nano_models.forEach(function (model) {
  test('[Nano ' + model.letter + '] create', zemu(model, async (sim, eth) => {
    // const contract = new ethers.Contract(contractAddr, abi);
    // const beneficiary = SPECULOS_ADDRESS;

    //https://polygonscan.com/tx/0x14297c32a09294e73649d27fb986ad4f433bbd3117ba48f5c2a97f68927dc627
    const data = "";
    // const data = "";
    //https://polygonscan.com/tx/0x151ca1f23334e538569082822b5fa2877c266b4d7219609d6c46dc30a6c20747
    // const data = "";
    //https://polygonscan.com/tx/0xaf433e69c2826392fa1982ea578c06a30692ab15cb5bb40e3f88a61e530c5ec9
    // const data = "";
    // LONG
    //https://snowtrace.io/tx/0x4c3ef17298a2e0a3ee98abffb03e72ac620c228806d92abdb4168f7c41036318
    // const data = "";

    const [resolution, serializedTx] = await resolveTxFromData(data, contractAddr);
    const tx = signTransaction(serializedTx, resolution, eth.signTransaction)

    const right_clicks = model.letter === 'S' ? 6 : 5;

    // Wait for the application to actually load and parse the transaction
    await waitForAppScreen(sim);
    await sim.navigateAndCompareSnapshots('.', model.name + '_create', [right_clicks, 0]);
    await tx;
  }));
});

